import '../assets/styles/all.css';

const WritingPage = () => {

    return(
        <>
            <form className="writing_page">
                <article>
                    <div>
                        <h5>닉네임 : ㅇㅇ</h5>
                    </div>
                </article>
            </form>
        </>
    ) 
}

export default WritingPage;
